import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div className='container' style={{width:"100vw", height:"10vh",backgroundColor:"red"}}>
        </div>
      </header>

      <somediv />
    </div>
  );
}
function somediv(){
  return(
    <div className='container' style={{width:"100vw", height:"100vh",backgroundColor:"yellow"}}>
    </div>
  );
}
// export {somediv};
export default App;
